import './App.css';

import useFetch from './hooks/useFetch.js';
import useObtainAuth from './hooks/useObtainAuth.js';
function App() {

  // obtain the bearer token
  //const { token, loadingAuth, errorAuth } = useObtainAuth()

  const loadingAuth = false
  const token = "eyJhbGciOiJSUzI1NiIsImtpZCI6IkQ1QjdBOUIxODFFOEYxN0UwRTU5MkFFQTdBREFDRjk4IiwieDV0IjoiZmFxUHJnMW5adU1RSjJidTByVXJWbGp1eVVJIiwidHlwIjoiSldUIn0..mCsInK0ijA9BLMxNjesJFUoGPAavnWgDTVGubRxJqclUbAxTPJ1rGe5CxbOHlPEr2oJG3uV2YLXNYkA0MICXP_YXNXgpcRczSKXMUX0VRtVYXdIXoN5aV995-b39jBFzAQpIjznQAs42mvv2YW5TR11DU8CougXF4-hTBDUaqufmyYE57rcaHiA6H1GoUwEpl8A7C_6p8cweGTao5FHmOh-BwF583yIGs_c2AEE4ozSzfd7J82wmkrczFFwC5FQYCP3byyGwC4SM5Npi9_QiQXjamyBV7uRmcHSbLky5NBd7Wc6ZprrNj8XL5DVAAeBsMWVhJ-IQ_Mkd7ShuGtafhg"

  const { data1, loading, error } = useFetch(token)

  return (
    <div className="App">
      {loading === true ? (
        <div>Loading...</div>
      ) : (
        <>
          <h1>Users</h1>
          <table border={1}>
            <tr>
              <th>Name</th>
              <th>Type</th>
              <th>Added</th>
              <th>Address</th>
            </tr>
            {data1.map(data => (
              <tr key={data.data.firmID}>
                <td>{data.data.firmName}</td>
                <td>{data.data.firmType}</td>
                <td>{data.data.yearEst}</td>
                <td>{data.data.address}</td>
              </tr>
            ))}
          </table>
        </>
      )}
    </div>
  )
}

export default App;
